from rest_framework import authentication, permissions
from rest_framework.decorators import api_view
from rest_framework.response import Response
from django.contrib.auth.models import User
from django.contrib.auth.models import AnonymousUser
from django.contrib.auth import authenticate
from django.contrib.auth.forms import AuthenticationForm
from django.contrib.auth.mixins import LoginRequiredMixin
from django.shortcuts import redirect
from django.http import JsonResponse
from django.views.decorators.csrf import csrf_exempt
from django.contrib.auth.models import User
from .models import MyUserModel

class JWTAuthentication(authentication.Authentication):
    def authenticate(self, request, *args, **kwargs):
        try:
            token = request.META.get('HTTP_AUTHORIZATION')
            data = JsonWebToken(token)
            user = data.get('user')
            if user and user != request.user.username:
                user = authenticate(request, username=user, password=data.get('password'))
                if user is not None:
                    return user
        except (KeyError, ValueError):
            return None

@api_view(['POST'])
@login_required
def login(request):
    form = AuthenticationForm(request, data=request.POST)
    if form.is_valid():
        # authentication logic
        return redirect('my_list')
    else:
        return JsonResponse({'error': form.errors})

class MyUserSerializer(serializers.ModelSerializer):
    class Meta:
        model = MyUserModel
        fields = ('id', 'username', 'email', 'first_name', 'last_name')

@api_view(['POST'])
@permission_classes([permissions.IsAuthenticated])
def my_list(request):
    user = request.user.username
    data = MyUserModel.objects.filter(username=user)
    serializer = MyUserSerializer(data, many=True)
    return JsonResponse(serializer.data)
